function spyProperties(a,b){Object.keys(b).forEach(function(f){try{var e;var c;e=performance.now();b["__"+f]=b[f];b[f]=undefined;c=performance.now();Object.defineProperty(b,f,{get:function(){console.debug("[Property Usage (%time%)] %debugNamespace.%property".replace("%time%",(c-e).toFixed(4)).replace("%debugNamespace",a).replace("%property",f));return b["__"+f]}})}catch(d){if(b["__"+f]){b[f]=b["__"+f];b["__"+f]=undefined}}})};